VALUES ('7622210795373', 'L\'œuf coque OREO', 'Sucre, graisses végétales (palme, palmiste, karité), lait écrémé en poudre, beurre de cacao, pâte de cacao, lactoserum en poudre (de lait), beurre concentré, farine de blé, lait, émulsifiants (lécithine de soja, E476, E475 E442, lécithine de tournesol), poudres à lever (E501, E503, E500, E504), arômes, sel, azote (pour l\'aération du fourrage). 20 % de lait écrémé en poudre dans le fourrage, crème confiseur au lait. Peut contenir autres fruits à coque. cacao en poudre fortement dégraissé (0,2 % ), pâte de noisettes, sirop de glucose-fructose, amidon de blé, Alpenmelkchocolamet cacao en cacaohiscuitstukjes (4,5%) en een melkcrèmevulling (42 %) met vanillesmaak. Ingrediënten: Suiker, plantaardige vetten (palm, palmpit, shea), magere melkpoeder, cacaoboter, cacaomassa, weipoeder (van melk), melkvet, tarwebloem, melk, emulgatoren (sojalecithine, E476, E475, E442, zonnebloemlecithine), magere cacaopoeder (0,2 %), hazelnootpasta, glucose-fructosestroop, tarwezetmeel, rijsmiddelen (E501, E503, E500, E504), aroma\'s, zout. Vulling belucht met stikstof 20 % magere melkpoeder in de melkcrèmevulling. Kan andere noten bevatten. FRXBE CUILLERE: LAVER AVANT UTILISATION. B LEPELTJE: AFWASSEN VOOR GEBRUIK.', 'https://static.openfoodfacts.org/images/products/762/221/079/5373/front_fr.4.400.jpg', '35', '17', '54', '51', '', '6.7', '0.38', '0.149606299212598', '', '0');

