VALUES ('7622210795618', 'Mikado intense pointe de sel', 'Farine de _blé_, sucre, páte de cacao, graisses végétales (palme, noix de coco), beurre de cacao, lactosérum en poudre (de _lait_), cacao maigre en poudre (1,7 %), sel (0,9 %), _beurre_ concentré, émulsifiants (lécithine de _soja_, E476), poudre à lever (E503), ardómes, levure.  Peut contenir _fruits à coque_.', 'https://static.openfoodfacts.org/images/products/762/221/079/5618/front_fr.4.400.jpg', '18', '10', '65', '32', '6.2', '6.7', '1.26', '0.496062992125984', '', '0');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('7622210795663', 'Mikado Caramel pointe de sel', 'Farine de blé, sucre, pâte de cacao, graisses végétales (palme, noix de coco), sirop de glucose, lactosérum en poudre (de lait), cacao maigre en poudre (l ,7 %), beurre de cacao, sel (0,9% ), beurre concentré, émulsifiants (lécithine de soja, E476), arômes, poudre à lever (E503), levure. Peut contenir fruits à coque. @Cacaobiscuits gedeeltelijk bedekt met chocolade (43 %) met zout en karamelstukjes (5 0%). Ingrediënten: Tarwebloem, suiker, cacaomassa, plantaardige vetten (palm, kokos), glucosestroop, weipoeder (van melk), magere cacaopoeder (1 ,7 %), cacaoboter, zout (0,9 %), melkvet, emulgatoren (sojalecithine, E476), aromds, rijsmiddel (E503), gist. Kan noten bevatten. @Galletas de cacao parcialmente cubiertas con chocolate (43 %) con sal y trozos de caramelo (5%). Ingredientes: Harina de trigo, azücar, pasta de cacao, grasas vegetales (palma, coco), jarabe de glucosa, suero de leche en polvo, cacao desgrasado en polvo (1 ,7 %), manteca de cacao, sal (0,9 %), grasa de leche anhidra, emulgentes (lecitina de soja, E476), aromas, gasificante (E503), levadura. Puede contener frutos de céscara. @Biscotti al cacao parzialmente ricoperti di cioccolato fondente (43 %) con sale e pezzi di caramello (5 %). Ingredienti: Farina di frumento, zucchero, pasta di cacao, grassi vegetali (palma, cocco), sciroppo di glucosio, siero di latte in polvere, cacao magro in polvere (1 ,7 %), burro di cacao, sale (0,9 %), grasso del latte, emulsionanti (lecitine di soia, E476), aromi, agente lievitante (E503), Iievito. Pub contenere frutta a guscio. @Cocoa biscuits partially coated With chocolate (43 %) With salt and caramel pieces (5%). Ingredients: Wheat flour, sugar, cocoa mass, vegetable fats (palm, coconut), glucose syrup, whey powder (from milk), fat-reduced cocoa powder (1 ,7 %), cocoa butter, salt (0,9 %), milk fat, emulsifiers (soya lecithin, E476),', 'https://static.openfoodfacts.org/images/products/762/221/079/5663/front_fr.11.400.jpg', '17', '9.5', '67', '33', '5.8', '6.5', '1.3', '0.511811023622047', '', '0');

