VALUES ('7622210932327', 'Grany Moelleux Muesli Chocolat', 'Muesli 27,8% (flocons d\'_avoine_ 11,2 %, raisins secs 10,4 %, noix de coco 3,7 %, pétales de maïs 2,5 % (maïs 2,4 %, sucre, sel, extrait de malt d\'_orge_)), farine de blé 143 %, sucre, huile de palme sirop de glucose, _lait_ écrémé en poudre, pépites de chocolat 5,6 % [sucre, pâte de cacao, graisses végétales (palme, karité en proportions variables), dextrose, beurre de cacao, émulsifiant (lécithines de _soja_), stabilisant (sirop de sorbitol), purée d\'abricot 3,2 %, cacao maigre en poudre, poudre à lever carbonates de sodium, diphosphates), sirop de fructose-glucose, amidon modifié, purée de pomme concentrée 0,7 % (équivalent purée de pomme 4,1 %), humectant (glycérol), fibres de _blé_, sel, acidifiant : acide citrique), gélifiants (pectines,gomme gellane), correcteur d\'acidité (citrate tricalcique), arômes.', 'https://static.openfoodfacts.org/images/products/762/221/093/2327/front_fr.4.400.jpg', '15', '8.2', '59', '34', '', '6.6', '1.31', '0.515748031496063', '', '0');

