VALUES ('7622210932341', 'Grany Moelleux Pomme Abricot', 'Muesli 29,8 % [raisins secs 12,3 %, flocons d\'_avoine_ 11,3 %, pétales de maïs 3,1 % (maïs 2,9 %, sucre, sel, extrait de malt d\'_orge_), noix de coco 2,5 %, abricots secs 0,6 % (équivalent abricot 3,3 %), farine de _blé_ 14,4 %, sucre, huile de palme, sirop de glucose, lait écrémé en poudre, stabilisant (sirop de sorbitol), purée d\'abricots 3,3 %, sirop de fructose-glucose, pépites à l\'abricot 1,3 % pulpe d\'abricots 0,4 %, sucre, pulpe de pomme 0,2 % fibres d\'ananas, épaississants (alginate de sodium, phosphate dicalcique), arômes, colorant (bêta-carotène), acidifiant (acide citrique), correcteur d\'acidité (citrate tripotassique)], poudre à lever (diphosphates, carbonates de sodium), amidon modifié, purée de pommes concentrée 0,7 % (équivalent purée de pommes 4,6 %), humectant (glycérol), fibres de blé, acidifiant (acide citrique), sel, arômes, gélifiants (pectines, gomme gellane), correcteurs d\'acidité (citrate tricalcique, citrate trisodique), dextrose.', 'https://static.openfoodfacts.org/images/products/762/221/093/2341/front_fr.4.400.jpg', '14', '7.2', '61', '35', '', '6.4', '0.82', '0.322834645669291', '', '0');

